  o.a = clamp01(o.a);
  o.r = clamp01(o.r);
  o.g = clamp01(o.g);
  o.b = clamp01(o.b);
  o *= color;
  ALPHA_TEST(o);
  return o;
}
layout(location = 0) out vec4 cc_FragColor;
void main() { cc_FragColor = frag(); }

